import {Routes, Route, Router} from 'react-router-dom'
import './App.css';
import Navbar from './components/Navbar';
import { home } from './components/home';



function App() {
  return (
  <Router>
    <div className="App">

      <Navbar/>
      <Routes>
        <Route path="/" element={<home />}/>
        <Route path="/mental-health" element={<mental />}/>

      </Routes>

    </div>
    </Router>
  );
}

export default App;
